o not have tasks as their specific objectives, they can fake “completing” certain activities as a way to gain everyone else's trust. Every user has a chance to call an emergency meeting or, upon seeing a dead body, to report it to everyone else. For the mobile release, discussions are only possible during these time-limited events.\n\nIf you are an Impostor, your main goal is to convince others that you are not the Impostor, while the Crew's job is to spot you out. Since it is a voting system where the person with the most votes gets eliminated from the game, it does not really matter who does what. Instead, your argumentative powers are what makes a difference. To sway people in one direction or another, you have to be prepared to make your case as convincing as possible. There is a short time-limit, so you either have to present very strong evidence or come up with a believable narrative that will take others off your trail.\n\nWhen you are killed by the Impostor, you become a ghost. Although you cannot interact or discuss with others, you can help them complete tasks.\n\nStreamers complained about chat being main form of communications, so a lot of streamers used discord for voice chat.\n\n#AmongUs #AmongUsMeme\n#AmongUsAnimation","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/YTrJ_w2qEFk/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDK3tpNMgDbu8AVlZQXCxWTS7ASnw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/YTrJ_w2qEFk/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLC_qJZPI9pGAM0k4zxf-O5bGWkiPQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/YTrJ_w2qEFk/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBx5UQcEJrIHzAsywM4h5XTjIsXlQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/YTrJ_w2qEFk/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLB8l8i ican made science fiction based murder mystery video game developed and published by Innersloth. Inc. It was released for IOS and Android on June 15, 2018, for PC on Steam on August 18, 2018 and for Dajolg on November 2, 2018. Among Us follows a crew being picked off one by one by an impostor.\n\nIn each game the player is one of 4 to 10 living and working in several different environments. One of these crewmates is an Impostor whose main goal is to kill everyone else. The remainder of the players are part of the regular crew who are just trying to escape unharmed. To do this, they have to complete several tasks or (better yet) find the Impostor and vote them out Survivor-style. If they are successful, the Crew wins. If the Impostor manages to kill them all, the player is victorious. In a 10 player game with one Impostor, there is a 10% chance of being an Impostor.\n\nThe free map, Skeld, has 14 different rooms that are connected by 7 hallways. Everyone begins the game in the Cafeteria and, depending on the host's settings, as well as on RNG, Crew members have to visit some or most of the other rooms to complete their tasks.\n\nWhile Impostors do not have tasks as their specific objectives, they can fake “completing” certain activities as a way to gain everyone else's trust. Every user has a chance to call an emergency meeting or, upon seeing a dead body, to report it to everyone else. For the mobile release, discussions are only possible during these time-limited events.\n\nIf you are an Impostor, your main goal is to convince others that you are not the Impostor, while the Crew's job is to spot you out. Since it is a voting system where the person with the most votes gets eliminated from the game, it does not really matter who does what. Instead, your argumentative powers are what makes a difference. To sway people in one direction or another, you have to be prepared to make your case as convincing as possible. There is a short time-limit, so you either have to present very strong evidence or come up with a believable narrative that will take others off your trail.\n\nWhen you are killed by the Impostor, you become a ghost. Although you cannot interact or discuss with others, you can help them complete tasks.\n\nStreamers complained about chat being main form of communications, so a lot of streamers used discord for voice chat.\n\n#AmongUs #AmongUsMeme\n#AmongUsAnimation"},"lengthSeconds":"155","ownerProfileUrl":"http://www.youtube.com/@HornstrompGames","externalChannelId":"UCpRx8BFSkdVx8MAW8unaJcw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"63409887","category":"Gaming","publishDate":"2020-09-23T11:03:43-07:00","ownerChannelName":"Hornstromp Games", ajolg on November 2, 2018. Among Us follows a crew being picked off one by one by an impostor.\n\nIn each game the player is one of 4 to 10 living and working in several different environments. One of these crewmates is an Impostor whose main goal is to kill everyone else. The remainder of the players are part of the regular crew who are just trying to escape unharmed. To do this, they have to complete several tasks or (better yet) find the Impostor and vote them out Survivor-style. If they are successful, the Crew wins. If the Impostor manages to kill them all, the player is victorious. In a 10 player game with one Impostor, there is a 10% chance of being an Impostor.\n\nThe free map, Skeld, has 14 different rooms that are connected by 7 hallways. Everyone begins the game in the Cafeteria and, depending on the host's settings, as well as on RNG, Crew members have to visit some or most of the other rooms to complete their tasks.\n\nWhile Impostors do not have tasks as their specific objectives, they can fake “completing” certain activities as a way to gain everyone else's trust. Every user has a chance to call an emergency meeting or, upon seeing a dead body, to report it to everyone else. For the mobile release, discussions are only possible during these time-limited events.\n\nIf you are an Impostor, your main goal is to convince others that you are not the Impostor, while the Crew's job is to spot you out. Since it is a voting system where the person with the most votes gets eliminated from the game, it does not really matter who does what. Instead, your argumentative powers are what makes a difference. To sway people in one direction or another, you have to be prepared to make your case as convincing as possible. There is a short time-limit, so you either have to present very strong evidence or come up with a believable narrative that will take others off your trail.\n\nWhen you are killed by the Impostor, you become a ghost. Although you cannot interact or discuss with others, you can help them complete tasks.\n\nStreamers complained about chat being main form of communications, so a lot of streamers used discord for voice chat.\n\n#AmongUs #AmongUsMeme\n#AmongUsAnimation","commandRuns":[{"startIndex":70,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CN8BEM2rARgBIhMIse66otbthwMVcQweAB28RzAa","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=IY3awpU6B9k\u0026list=PLAmONQP8hmuyu3uLv3ON_CFQnfA2RAutD\u0026index=1\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"IY3awpU6B9k","playlistId":"PLAmONQP8hmuyu3uLv3ON_CFQnfA2RAutD","index":0,"startTimeSeconds":0,"loggingContext":{"vssLoggingContext":{"serializedContextData":"GiJQTEFtT05RUDhobXV5dTN1THYzT05fQ0ZRbmZBMlJBdXRE"}},"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-5h25gvcg-8j2e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=218ddac2953a07d9\u0026ip=177.67.157.112\u0026initcwndbps=963750\u0026mt=1723404058\u0026oweuc=\u0026pxtags=Cg4KAnR4Egg1MTIxOTc3MQ\u0026rxtags=Cg4KAnR4Egg1MTE5MTQ2MA%2CCg4KAnR4Egg1MTE5MTQ2MQ%2CCg4KAnR4Egg1MTE5MTQ2Mg%2CCg4KAnR4Egg1MTIxOTc3MQ"}}}}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: ⭐️ DAD IMPOSTOR VS REDD - AMONG US AN..."}}},{"startIndex":2586,"length":8,"onTap":{"innertubeCommand":{"clickTrackingParams":"COIBENzXBBgJIhMIse66otbthwMVcQweAB28RzAa","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/amongus","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gULCgdhbW9uZ3VzGAE%3D"}}},"loggingDirectives":{"trackingParams":"COIBENzXBBgJIhMIse66otbthwMVcQweAB28RzAa","enableDisplayloggerExperiment":true}},{"startIndex":2595,"length":12,"onTap":{ rl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCpRx8BFSkdVx8MAW8unaJcw","canonicalBaseUrl":"/@HornstrompGames"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/PhpCPLmDZxfERtvNoEkWcBo90S9J0xU-_RQ_Hs4sOjmbONIblApv42eSc8t1mNh2u8Om5XRp8Q=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"A normal day in Among Us animation part 2!\n\nBest Among Us Animations:    • ⭐️ DAD IMPOSTOR VS REDD - AMONG US AN...  \n\nThanks you so much for support me! \nI love you! ❤️\n\nOriginal Animation by Hornstromp.\n\nAmong Us is an American made science fiction based murder mystery video game developed and published by Innersloth. Inc. It was released for IOS and Android on June 15, 2018, for PC on Steam on August 18, 2018 and for Dajolg on November 2, 2018. Among Us follows a crew being picked off one by one by an impostor.\n\nIn each game the player is one of 4 to 10 living and working in several different environments. One of these crewmates is an Impostor whose main goal is to kill everyone else. The remainder of the players are part of the regular crew who are just trying to escape unharmed. To do this, they have to complete several tasks or (better yet) find the Impostor and vote them out Survivor-style. If they are successful, the Crew wins. If the Impostor manages to kill them all, the player is victorious. In a 10 player game with one Impostor, there is a 10% chance of being an Impostor.\n\nThe free map, Skeld, has 14 different rooms that are connected by 7 hallways. Everyone begins the game in the Cafeteria and, depending on the host's settings, as well as on RNG, Crew members have to visit some or most of the other rooms to complete their tasks.\n\nWhile Impostors do not have tasks as their specific objectives, they can fake “completing” certain activities as a way to gain everyone else's trust. Every user has a chance to call an emergency meeting or, upon seeing a dead body, to report it to everyone else. For the mobile release, discussions are only possible during these time-limited events.\n\nIf you are an Impostor, your main goal is to convince others that you are not the Impostor, while the Crew's job is to spot you out. Since it is a voting system where the person with the most votes gets eliminated from the game, it does not really matter who does what. Instead, your argumentative powers are what makes a difference. To sway people in one direction or another, you have to be prepared to make your case as convincing as possible. There is a short time-limit, so you either have to present very strong evidence or come up with a believable narrative that will take others off your trail.\n\nWhen you are killed by the Impostor, you become a ghost. Although you cannot interact or discuss with others, you can help them complete tasks.\n\nStreamers complained about chat being main form of communications, so a lot of streamers used discord for voice chat.\n\n#AmongUs #AmongUsMeme\n#AmongUsAnimation","commandRuns":[{"startIndex":70,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCQQ040EGAQiEwix7rqi1u2HAxVxDB4AHbxHMBo=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=IY3awpU6B9k\u0026list=PLAmONQP8hmuyu3uLv3ON_CFQnfA2RAutD\u0026index=1\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"IY3awpU6B9k","playlistId":"PLAmONQP8hmuyu3uLv3ON_CFQnfA2RAutD","index":0,"startTimeSeconds":0,"loggingContext":{"vssLoggingContext":{"serializedContextData":"GiJQTEFtT05RUDhobXV5dTN1THYzT05fQ0ZRbmZBMlJBdXRE"}},"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-5h25gvcg-8j2e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026
